import React from 'react'
import { graphql, useStaticQuery } from 'gatsby';
import { Container } from 'react-bootstrap';
import styles from "./index.module.scss"
import Img from "gatsby-image"

const MainImage = () => {
  const data = useStaticQuery(graphql`
    query {
        mobileImage: file(relativePath: { eq: "homepage/section1/main-mobile.png" }) {
          childImageSharp {
            fluid(maxWidth: 1000, quality: 100) {
              ...GatsbyImageSharpFluid
            }
          }
        }
        desktopImage: file(
          relativePath: { eq: "homepage/section1/main.png" }
        ) {
          childImageSharp {
            fluid(maxWidth: 2000, quality: 100) {
              ...GatsbyImageSharpFluid
            }
          }
        }
      }       
    `)
  const sources = [
    data.mobileImage.childImageSharp.fluid,
    {
      ...data.desktopImage.childImageSharp.fluid,
      media: `(min-width: 768px)`,
    },
  ]
  return (
    <Img fluid={sources} />
  )
}


interface Props { }
const section = (props: Props) => {
  return (
    <div className={styles.mainContainer} id="testDivID">
      <MainImage />
      <div
        id="homeSec1_Overlay"
        className={styles.overlayContainer}
        onMouseEnter={() => {
          document.getElementById("homeSec1_Overlay").classList.toggle(styles.overlayContainer_clear)
        }}
        onMouseLeave={() => {
          document.getElementById("homeSec1_Overlay").classList.toggle(styles.overlayContainer_clear)
        }}>
        <div className={styles.dot}>
          <div className={styles.dot_dot}></div>
        </div>
        <div
          className={styles.overlay}
          style={{}}>
        </div>
      </div>
    </div >
  )
}

const SVG_1_1 = () => (
  <div className="" style={{position:"absolute", top:0, left:0}}>
    <div
      className="HPsec1_svg1Highlight_container"
      style={{ zIndex: 20 }}
    >
      <div
        style={{
          alignContent: "center",
          color: "#fff",
          zIndex: 5,
        }}
      >
        {window.innerWidth > 600 ? "Scroll" : "Tap"} over
      </div>
    </div>
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width="1920"
      height="880"
      viewBox="0 0 1920 880"
      className="HP_sec1img1A--svg1 banner_img_1"
      id="HP_sec1img1A--svg1"
    >
      <defs>
        <clipPath id="clip-HP_sec1img1A::svg1">
          <rect width="1920" height="880" />
        </clipPath>
      </defs>
      <g id="HP_sec1img1A::svg1" clip-path="url(#clip-HP_sec1img1A::svg1)">
        <rect
          id="Rectangle_64"
          data-name="Rectangle 64"
          width="2178"
          height="187"
          transform="translate(-129 -132)"
          fill="#fff"
        />
        <rect
          id="Rectangle_3315"
          data-name="Rectangle 3315"
          width="2178"
          height="187"
          transform="translate(-181 834)"
          fill="#fff"
        />
        <path
          id="Path_1461"
          data-name="Path 1461"
          d="M824.5,0c455.359,0,215.346,520.112,504.723,825.5S1279.859,1649,824.5,1649,0,1279.859,0,824.5,369.141,0,824.5,0Z"
          transform="translate(-552 -369)"
          style={{
            mixBlendMode: "hard-light",
            isolation: "isolate",
            opacity: 1,
          }}
        />
        <path
          id="Path_121"
          data-name="Path 121"
          d="M.067-.333c136.709-4.43,229.358,4.524,229.358,4.524s.505,76.9,2.122,121.489c-114.7-1.939-112.443-.646-231.48,1.342C-.445,80.767.481,76.872.067-.333Z"
          transform="translate(70.342 112.989)"
          style={{
            mixBlendMode: "hard-light",
            isolation: "isolate",
            opacity: 1,
          }}
        />
      </g>
    </svg>
  </div>
);

export default section;
